import React, { Component } from 'react';
import { Container, Icon, Hero, HeroBody, Title, NavItem, Nav, NavLeft, NavCenter } from 'bloomer';
import Xml2Json from '../components/Xml2Json';
class Header extends Component {
    constructor(props) {
        super(props);
        this.state = {
            xmlFile: ""
        }
        this.handler = this.handler.bind(this);
    }
    handler(state) {
        this.setState(state);
    }

    render() {
        return (
            <Hero isColor='info' style={{marginTop: 10, fontSize: 30, marginBottom: 10}}>
                <HeroHeader>
                    <Nav>
                        <NavLeft>
                            <NavItem isBrand>Bloomer</NavItem>
                        </NavLeft>
                        <NavCenter>
                            <NavItem>
                                <Icon className="fa fa-github" />
                            </NavItem>
                            <NavItem>
                                <Icon className="fa fa-twitter" />
                            </NavItem>
                        </NavCenter>
                        <NavRight isMenu>
                            <NavItem>Home</NavItem>
                            <NavItem>Documentation</NavItem>
                        </NavRight>
                    </Nav>
                </HeroHeader>
                <HeroBody>
                    <Container hasTextAlign='centered'>
                        <Title>XML to Json</Title>
                    </Container>
                </HeroBody>
            </Hero>

        );
    }
}

export default Header;
